from selenium import webdriver
from selenium.webdriver.common.by import By
from selenium.webdriver.support.ui import WebDriverWait
from selenium.webdriver.support import expected_conditions as EC
import pandas as pd
from pymongo import MongoClient
import time


def selenium_scrap(path):
    # Подготовка драйвера
    driver = webdriver.Firefox(executable_path=r'./WebDriver/geckodriver')
    driver.maximize_window()
    driver.get(path)
    button = WebDriverWait(driver, 10).until(EC.presence_of_element_located((By.CLASS_NAME, 'glyphicon-plus')))
    button.click()
    data = driver.find_element_by_id('homematrix')
    time.sleep(2)
    table_rows = data.find_elements_by_tag_name('tr')
    dataset = []
    for tr in table_rows:
        td = tr.find_elements_by_tag_name('td')
        if not td:
            td = tr.find_elements_by_tag_name('th')
        row = [tr.text for tr in td]
        dataset.append(row)
    print('Скрапинг завершен!')
    driver.close()

    # Убираем точки из наименования колонок (требование MongoDB)
    for ind, i in enumerate(dataset[0]):
        dataset[0][ind] = str(i).replace('.', '')

    df = pd.DataFrame(dataset[1:], columns=dataset[0])
    df.reset_index(drop=True, inplace=True)
    df.to_excel('2_macro.xls')
    return df.to_dict('records')


def main():
    # Скрапинг
    path = 'https://tradingeconomics.com/'
    dataset = selenium_scrap(path)

    ### Подготовка базы данных
    client = MongoClient('192.168.1.6', 27017)  # подключение к виртуальной машине
    db = client['economics']  # указание базы данных
    economics = db.economics  # указание коллекции
    economics.insert_many(dataset)  # вставка в БД
    print('данные успешно добавлены в MongoDB')
    for n in economics.find({}):
        print(n)


if __name__ == '__main__':
    main()

